import React from "react";
import SearchForecast from "./SearchForecast";
import {ThreeDaysForecast} from "./ThreeDaysForecast";

export function Location() {
  return (
    <React.Fragment>
      <h1 style={{ color: "red" }}>Location component</h1>
      <h2 style={{ color: "red" }}>{this.props.city}</h2>
      <SearchForecast city={this.props.city} />
      <ThreeDaysForecast />
    </React.Fragment>
  );
}
